import './Productosbanner.css';
import Registrobanner from '../../assets/img/bannerregistroproducto.jpg';
import BotonCerrarSesion from '../../assets/img/cerrarsesion.png';



function Productosbanner(){
    return(
    		<div className="container">
                <img src={Registrobanner} width="100%"/><button><img src={BotonCerrarSesion} width="64px"/></button>
			</div>

    );
}
export default Productosbanner;
